import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav style={{ padding: "10px", background: "#222" }}>
      <Link to="/" style={{ color: "#fff", margin: "10px" }}>Dashboard</Link>
      <Link to="/courses" style={{ color: "#fff", margin: "10px" }}>Courses</Link>
      <Link to="/lessons" style={{ color: "#fff", margin: "10px" }}>Lessons</Link>
      <Link to="/profile" style={{ color: "#fff", margin: "10px" }}>Profile</Link>
    </nav>
  );
}
